  false,\n\t\"url\": null,\n\t\"notes\": \"Degree slope of Stellwagen Bank bathymetry.
  Raster derived from 5-meter bathymetric contour lines (Quads 1-18). Collected on
  surveys carried out in 4 cruises 1994 - 1996 using the Kongsberg SIMRAD EM1000 multibeam
  system on the CHS vessel Frederick G. Creed. For each quad, multibeam data was processed,
  converted to an ARC/INFO point coverage, gridded with a cell-size of 13m and contoured
  at an interval of 5m. 18 quads were merged into one shapefile for convenience in
  this publication. Scale 1:25,000\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
